INSERT INTO `contact_us` (`c_id`, `name`, `email`, `phone`, `subject`, `message`, `c_date`) VALUES
(1, 'Rosabel Beteille', 'beteillerosabel@gmail.com', '1201201200', 'Traffic to your website', '\"Hello,\r\nWe are interested to increase traffic to your website, please get back to us in order to discuss the possibility in further detail.\r\nBest Regards\"', '2018-06-26 08:10:15'),
(2, 'Sandra Melton', 'sandramelton.buss@gmail.com', '120-210-1201', 'Online Marketing of your business', 'We can increase rankings of your website in search engines. Please reply to this message and we will prepare a special proposal for you.', '2018-07-03 04:44:44'),
(3, 'Dimitri', 'noreply@socialchief.co', '123-123-1234', 'Help with growing on Instagram', 'Hello!\r\n \r\nI hope you are well. I thought I would reach out and see if you needed any help with your Instagram growth. We are a small and friendly agency specialised in Instagram for luxury and lifestyle brands. We can generate an organic following of real, genuine people, who fit your target group. \r\n\r\nWe will target followers of popular accounts in your niche. We will engage with the most engaged users by following them and liking their most recent posts on their accounts, and by doing so attracting attention to your account. \r\n\r\nMore followers =\r\n\r\n* More exposure for your business, increase sales;\r\nReach highly targeted customers for your business who will convert into clients, leads and sales!\r\n\r\n* Larger audience for Infuencers;\r\nYour posts will reach more people raising the value of your posts.\r\n\r\n* Increase sales and brand awareness; \r\nYour business, your name, your account will be seen by thousands of people a day. Exposing potential buyers to your brand again and again is part of the consumer journey.\r\n\r\nOur most popular plan starts at 69 USD per month, for which you will get around 1000+ targeted followers each month.  \r\n\r\nWe have a $1 1 week trial: https://socialchief.co/get-started/\r\n\r\nIf you have any questions, please let me know. You can contact me at dimitri@socialchief.co or with the chat on the website. I\'m looking forward to hearing from you!\r\n \r\nBest regards,\r\nDimitri Visser \r\nemail: dimitri@socialchief.co\r\nskype: dimitrivisser\r\nphone: 833-350-8008\r\nwhatsapp: +31-6-36001250', '2018-09-10 21:18:08'),
(4, 'Randy', 'Randy@TalkWithLead.com', '416-385-3200', 'Concerning haha1288.com', 'Hi,\r\n\r\nMy name is Randy and I was looking at a few different sites online and came across your site haha1288.com.  I must say - your website is very impressive.  I found your website on the first page of the Search Engine. \r\n\r\nHave you noticed that 70 percent of visitors who leave your website will never return?  In most cases, this means that 95 percent to 98 percent of your marketing efforts are going to waste, not to mention that you are losing more money in customer acquisition costs than you need to.\r\n \r\nAs a business person, the time and money you put into your marketing efforts is extremely valuable.  So why let it go to waste?  Our users have seen staggering improvements in conversions with insane growths of 150 percent going upwards of 785 percent. Are you ready to unlock the highest conversion revenue from each of your website visitors?  \r\n\r\nTalkWithLead is a widget which captures a website visitor’s Name, Email address and Phone Number and then calls you immediately, so that you can talk to the Lead exactly when they are live on your website — while they\'re hot! Best feature of all, we offer FREE International Long Distance Calling!\r\n  \r\nTry the TalkWithLead Live Demo now to see exactly how it works.  Visit: https://www.talkwithlead.com/Contents/LiveDemo.aspx\r\n\r\nWhen targeting leads, speed is essential - there is a 100x decrease in Leads when a Lead is contacted within 30 minutes vs being contacted within 5 minutes.\r\n\r\nIf you would like to talk to me about this service, please give me a call.  We do offer a 14 days free trial.  \r\n\r\nThanks and Best Regards,\r\nRandy', '2018-09-27 14:58:39');
